	function shakingAnimation(timestamp){
		var hamsterMarginTop = 22.3;
		var hamsterMarginLeft = 40.5;
		var hamsterHeight = 35;
		var hamsterWidth = 17;
		var shakingToggle = 0;
		var count = 0;
		if (shakingToggle === 0){ 
			function upDownShake(timestamp){
				if(hamsterMarginTop >= 22){
					hamsterMarginTop-=0.03;
					mc.style.marginTop = hamsterMarginTop + "%";
					updown= requestAnimationFrame(upDownShake);
				}
				if(hamsterMarginTop <= 22 && count<2){
					count++;
					hamsterMarginTop = 22.3;
					mc.style.marginTop = hamsterMarginTop + "%";
					stopDuration=60;
				}
				if (count === 2 && hamsterMarginTop >= 22.3){
					function durationAnimation(timestamp){
						if( stopDuration > 0){
							stopDuration--
							cancelAnimationFrame(updown);
							if (stopDuration===0){
								count=0;
								updown = requestAnimationFrame(upDownShake);
							}duration = requestAnimationFrame(durationAnimation);
						}
					}duration = requestAnimationFrame(durationAnimation);
				}
			}updown= requestAnimationFrame(upDownShake);
			shakingToggle = 1;		
		}shaking = requestAnimationFrame(shakingAnimation);
	}
		
